const helper = function(){
    const getCategoryImage = function(category){
        switch(category){
            case 'Vegetables and legumes/beans':
                return "data:image/jpeg;base64,";
            case 'Fruits':
                return "data:image/jpeg;base64,"
            case 'Grain Food':
                return "https://media.self.com/photos/5af072918f8543366c0ef1e6/4:3/w_728,c_limit/bread.jpg";
            case 'Milk, cheese, eggs and alternatives':
                return "data:image/jpeg;base64,";
            case 'Lean meats and poultry, fish and alternatives':
                return "data:image/jpeg;base64,";
        }
    }

    const getCategoryId = function (category) {
        switch (category) {
            case 'Vegetables and legumes/beans':
                return 1;
            case 'Fruits':
                return 2;
            case 'Grain Food':
                return 3;
            case 'Milk, cheese, eggs and alternatives':
                return 4;
            case 'Lean meats and poultry, fish and alternatives':
                return 5;
        }
    }
    
    return {
        getCategoryImage,
        getCategoryId
    };
}();